INSERT INTO `aircrafttype` VALUES (1,'Boeing 737','High metal material aircraft, short-to medium-range twinjet narrow-body airliner.Originally developed as a shorter,lower cost twin engined airliner derived from Boeing\'s 707 and 727,the 737 has developed into a family of nine passenger models with a capacity of 85 to 215 passengers ',1,'/src/images/aircrafttypes/Image-1657178470766.jpg'),(2,'Boeing 757','The Boeing 757 is an American narrow-body airliner designed and built by Boeing Commercial Airplanes ,High metal material aircraft',1,'/src/images/aircrafttypes/Image-1657178098210.jpg'),(3,'Airbus A380','Large wide-body airliner that was developed and produced by Airbus.It is the world\'s largest passenger airliner.Low metal material aircraft',1,'/src/images/aircrafttypes/Image-1657179737715.jpeg');
