/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `flight_after_update` AFTER UPDATE ON `flight` FOR EACH ROW BEGIN
    IF new.status=0 THEN
        Update flighttime set status=0 where flighttime.flightID=new.flightID;
    END IF;
    IF new.status=0 THEN
        Update booking set status=0 where booking.flightID=new.flightID and (now()<(select dispatchTime from flighttime join flight using(flightID)  where endTimeDate is null and flighttime.flightID=new.flightID)) ;
    END IF;
    
END */;;
