CREATE DEFINER=`root`@`localhost` PROCEDURE `get_dicountID_for_a_userID`(IN userID int, OUT discountID_value int)
BEGIN
DECLARE totalBookings INT DEFAULT 0;
    DECLARE currentDateTime DATETIME DEFAULT now();
    DECLARE latestNoDiscountID INT DEFAULT 0;
    DECLARE latestFrequentID INT DEFAULT 0;
    DECLARE latestGoldenID INT DEFAULT 0;
   
    SELECT COUNT(*) INTO totalBookings
    FROM booking
    WHERE registeredUserID=userID AND paymentStatus=1;
   
    SELECT discountID INTO latestNoDiscountID
    FROM discount
    WHERE discountClassType="NO_DISCOUNT" AND
    currentDateTime BETWEEN startTimeDate AND endTimeDate
    AND status=1
    ORDER BY discountID DESC LIMIT 1;
   
    SELECT discountID INTO latestFrequentID
    FROM discount
    WHERE discountClassType="FREQUENT" AND
    currentDateTime BETWEEN startTimeDate AND endTimeDate
    AND status=1
    ORDER BY discountID DESC LIMIT 1;
   
    SELECT discountID INTO latestGoldenID
    FROM discount
    WHERE discountClassType="GOLDEN" AND
    currentDateTime BETWEEN startTimeDate AND endTimeDate
    AND status=1
    ORDER BY discountID DESC LIMIT 1;
   
    IF totalBookings >= 10 THEN
SET discountID_value = latestGoldenID;
ELSEIF totalBookings >= 5 THEN
SET discountID_value = latestFrequentID;
ELSE
SET discountID_value = latestNoDiscountID;
    END IF;    

END ;;
DELIMITER ;
